import React, { Component } from 'react'
import { Navbar } from 'react-bootstrap'

class Home extends Component {
    render() {
        return(
            <div>
                <Navbar />
                <h1>Disney Harley</h1>
                <p className='brandStatement'>I am a motivated software engineer who is eager to expand my knowledge and connections to make a technical impact inthe world. As a veteran of the Military Igained skills to maintain focus andattention to detail and problem solvingskills. I have a passion for adventure andexperiencing different cultures and waysof life. I plan to use these skills  anddedication to help making dynamic andand user friendly web applications andexploring the world of design anddevelopment.</p>
            </div>
        )
    }
}

export default Home
